      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 69 + + 27 + - col0 * + col0 NOT IN ( - 20 * + col1, - col1, - col0 + - 19 - - - col2 + - + 71, - 65, + + col1, col2 );
  - name: tab1

outputs:
